import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';

import App from './app';
import store from './store/';

function Main() {
    return (
        <Provider>
            <React.StrictMode>
                <App />
            </React.StrictMode>
        </Provider>

    )
}

const rootElement = document.getElementById('root');
ReactDOM.render(<Main />, rootElement);
